('201503231701369408', '201503231642489870', '2015-03-23 17:01:36', 'false', '刚刚接触，微信联系。'),
('201503231714074572', '201503231713434614', '2015-03-23 17:14:07', 'false', '图纸已经完善，26号准备开工。'),
('201503231753501982', '201503231753146029', '2015-03-23 17:53:50', 'false', '林小姐联系电话：18605273418  老公：龚先生，45岁左右，生物学博士，经历较多，老家广西山区人，32岁毕业后结婚在深圳工作，林小姐之前做外贸，现在刚生完两个小孩，全职太太，本身8年国外留学生涯。现在在江苏宿州开了一个试剂研发厂。所以感觉最实在的方式对待他们会比较好。'),
('201503231754096988', '201503231753146029', '2015-03-23 17:54:09', 'false', '2室2厅90㎡'),
('201503241427212699', '201503231753146029', '2015-03-24 14:27:21', 'false', '已经跟客户沟通过，客户更希望简单居家型。小白和沈菁菁做方案。男房东是湖州师范，姓龚'),
('201503261645517367', '201503231753146029', '2015-03-26 16:45:51', 'false', '3.26日：林小姐已经看了平面方案图，简单报价5.5W，考虑到他们比较不方便，也给出了一个9.5W的全包价格。林小姐表示需要跟龚先生商量后，给我们一个答复。3.27日再与她联系'),
('201503271446228293', '201503271445122553', '2015-03-27 14:46:22', 'true', '量房已经量好，两套平面方案已经出好'),
('201503271447328788', '201503271445122553', '2015-03-27 14:47:32', 'false', '3.18号上门客户'),
('201503271447507608', '201503271445122553', '2015-03-27 14:47:50', 'false', '3.23 量房已经量好，两套平面方案已经出好'),
('201503271448124671', '201503271445122553', '2015-03-27 14:48:12', 'false', '3.25：参观韩总的房子'),
('201503271452076293', '201503271449418275', '2015-03-27 14:52:07', 'false', '3月24日：与白玉叶去量房，跟业主接触，开Q5，条件应该不错。是老房子改装。房子面积140+㎡，3人居住，准备装修好作为婚房。自身预算硬装9万左右，推荐他们重新装修。'),
('201503271452316326', '201503271449418275', '2015-03-27 14:52:31', 'false', '3月27日：平面方案已经一套出好，再出一套联系客户上面看方案。'),
('201503271454387279', '201503231753146029', '2015-03-27 14:54:38', 'false', '3月27日：电话联系客户，林小姐已经与龚先生谈过，第一，他们感觉预算还是比较紧凑。第二，准备等龚先生考虑好再订。第三，现在林小姐大儿子感冒比较严重。所以可能过几天才能给我们答复。'),
('201503300920285701', '201503271449418275', '2015-03-30 09:20:28', 'false', '3月27日过来看平面方案，大体确定，现在他们预算有变动硬装大概在六万多，客厅地面不想改掉。因为主卧拆除地面的改动。国庆节结婚要用到，建议客户四月份就地装修，工期给他大概说了是三个月（客厅与主卧，主卫返新）。前期按平面大概的报价是六万左右，他们感觉价格比较合理。提了下订金。回家考虑一下哪里还需要修改过两天来交订金。'),
('201503300925486182', '201503231753146029', '2015-03-30 09:25:48', 'false', '3月28日，电话联系，资金紧张想简装自己搞或找比的公司对比一下价格。在弄孩子幼儿园的事，4月1日上学后有空了再和我们回复。'),
('201503300928022247', '201503271445122553', '2015-03-30 09:28:02', 'false', '3月27日     电话联系没有空过来，还想咨询陶总价格的事'),
('201503300930081593', '201503271445122553', '2015-03-30 09:30:08', 'false', '3月29日 电话联系，本着他们双休日空闲的时间打去预约。客户在杭州没有空。过两天后再过来'),
('201503310918491978', '201503271449418275', '2015-03-31 09:18:49', 'false', '3月30日打电话联系，这两天有事过不来，等空了再过来打我电话。'),
('201503311545502254', '201503271445122553', '2015-03-31 15:45:50', 'false', '胡先生：13567253386'),
('201503311547238374', '201503311547142812', '2015-03-31 15:47:23', 'false', '阿迪是否为切尔加速度回复链接好'),
('201503311547477250', '201503311547142812', '2015-03-31 15:47:47', 'false', '4月2日：交押金2000元'),
('201504011736423685', '201503271449418275', '2015-04-01 17:36:42', 'false', '3.31：交定金1000，答应十天之内施工图效果图做好，要求七月初，六月底完工。'),
('201504031715163671', '201503271445122553', '2015-04-03 17:15:16', 'false', '4.3: 电话联系，清明扫墓比较忙没空。'),
('201504080914413128', '201504080906523715', '2015-04-08 09:14:41', 'false', '电话：13587924211（余先生）'),
('201504110957556280', '201504110955387579', '2015-04-11 09:57:55', 'false', '4.11 交订金1000元，客户性格啥地方了卡机的法律。'),
('201504111722317777', '201504080906523715', '2015-04-11 17:22:31', 'false', '4.8:早上客户自己一个人来，确定了平面方案，让交定金说没带下午来交，下午和女儿一起来了，改了女儿房，最终确定方案交了2000元定金'),
('201504111727189788', '201504080906523715', '2015-04-11 17:27:18', 'false', '4.11：早上约了客户，来确定一下风格，目前已确定为现代风格，由于这个客户在公司交了定金还去其它公司看，所以打算下次直接给他看施工图、预算、效果图，看完马上签合同；下午施工图已出完，交由小杨和小白审阅过，改了一下，已经发给张泽南做预算，同时也发出去做效果图 。'),
('201504111743111629', '201503271445122553', '2015-04-11 17:43:11', 'false', '4.10：打电话联系了客户向他说明现在有一个优惠的活动非常适合他，他老婆过来了给她介绍了活动内容，说回家和他老公商量一下。说明天还要去看小强的活动'),
('201504111746331498', '201503271445122553', '2015-04-11 17:46:33', 'false', '4.11:昨天没有给我回馈，今天早上给他发了短消息再次说明活动内容，定了时间4月15日前来交定金，到了下午四点多回了一句知道了。打算明天再问他考虑的怎么样了。再提醒一下时间。'),
('201504130042202221', '201504080906523715', '2015-04-13 00:42:20', 'false', '4.12日，签单成功，合同价74000元。商定4月13日开工'),
('201504132257272226', '201504132257173151', '2015-04-13 22:57:27', 'false', '爱的色放爱的色放'),
('201504132257311932', '201504132257173151', '2015-04-13 22:57:31', 'false', '阿道夫阿萨德凡'),
('201504200858535388', '201504200851339245', '2015-04-20 08:58:53', 'false', ' 客户电话：13754220945  \n房子十月份交付。前期先找几家公司设计一下，04.19号我们公司是第一家上门量房。简单的美式风格\n咨询公司样板房的优惠活动与力度，\n车子是尼桑浙C应该是温州的老板。家里有一个15岁的女儿。'),
('201504200905409539', '201504200900362153', '2015-04-20 09:05:40', 'false', '4.19上门咨询，两个小年轻婚房，女方家爸爸是个老木工都在乡下做，想找装修公司包轻工。又不想出设计费。');
INSERT INTO `censorship` (`id`, `logListId`, `content`, `isDeleted`, `createTime`, `userName`) VALUES
('201503111940371154', '201503111939034292', '出台教程', 'true', '2015-03-11 19:40:37', 'williamzhang'),
('201503161823176122', '201503161606559557', '3天之内完成', 'false', '2015-03-16 18:23:17', 'williamzhang'),
('201503172330208704', '201503161542534754', '预算已经可以初算，使用一下，有问题QQ提交给我', 'false', '2015-03-17 23:30:20', 'williamzhang'),
('201503202338371046', '201503161542534754', '在日志中关于联系材料商的事项时应注明，工程地址，联系事项，联系结果，是否与项目经理对接等，以便后期查询', 'false', '2015-03-20 23:38:37', 'clc8667668'),
('201503202349430548', '201503191734415289', '所写日志为什么是相同日期如果是软件问题，请联系张泽南；\n关于：材料定购方面应该写明，预定日期，供货日期，交接人，项目经理是否知晓，是否安公司要求交接', 'false', '2015-03-20 23:49:43', 'clc8667668'),
('201503210037426193', '201503171643045714', '小杭：你的工作日志写的好像有点怪异，工作日志是写当日的工作情况次日的工作安排，需要处理的重要事项等内容，除公司会议内容外像那些账号密码不应该写在那里哦，这也是公司的秘密，要注意。', 'false', '2015-03-21 00:37:42', 'clc8667668'),
('201503212002146132', '201503211704027416', '有了工作内容，应该有工作目标工作结果，是不是', 'false', '2015-03-21 20:02:14', 'clc8667668'),
('201503212009346053', '201503211157275091', '能及时跟进工作日志很好值得表扬，像今天下午关于玉墅林枫水池的情况应该写入日志，以便公司及时了解情况，对于类似问题在会议或布置工作中及时提醒及改进', 'false', '2015-03-21 20:09:34', 'clc8667668'),
('201503252234506552', '201503232159368471', '简爱工程进度赶快抓紧并落实到位，施工人员需增加\n下午去了工地检查，现场施工人员太少，必须增加人员，材料定购事项为什么设计师已定好了，你自己多不知道，作为现场管理人员这些多不关心怎么安排工期，你所汇报的工程进度安排是不是凭空想想的啊，希望看到这批阅能给我一个圆满的答复。\n工程增减联系单必须按公司标准流程，如果再不及时签订公司将做处罚，如果客户再不签就发停工通知单。', 'false', '2015-03-25 22:34:50', 'clc8667668'),
('201503252239097827', '201503231545272281', '曹世豪是应聘什么的怎么我不知道啊，怎么联系檀经理啊', 'false', '2015-03-25 22:39:09', 'clc8667668'),
('201503252240396263', '201503251616579237', '工作有进步值得表扬，再接再励，把微信做的更好', 'false', '2015-03-25 22:40:39', 'clc8667668'),
('201503252249553957', '201503201228038751', '好！工作做得很认真，给你点个赞；关于项目经理材料照片的情况应该让项目经理按公司要求执行，如果还是有类似情况，在日志中明确是哪位项目经理，以便我能及时了解沟通，日志只有我和仔仔能看到的，如果有些为难的情况你可以在日志中汇报', 'false', '2015-03-25 22:49:55', 'clc8667668'),
('201503260005163889', '201503161607166926', '1.你的日志怎么只有标题没有内容，如果不明白使用问仔仔，\n2，今天我约了小杭谈了公司4部手机如何加小区客户微信如何用微信销售事项，可能你下午有所知晓你尽量主动协助她，你负责两部手机小杭负责两部，我不宣布你们分工你主动和小杭沟通要两部手机过来管理，我想这样能体现你的工作主动提高其他员工的积极性；如有不明白的咨询我。\n3，你手头的工作完成了要及时与安排你工作的人沟通汇报并及时跟踪审核情况，不要做好了不汇报不跟踪这样的话工作永远跟不上的，要养成主动习惯提高工作效率；\n4，中午如需出去上班不要迟到，会影响公司其他员工的心态的，我们早上已经不遵守公司制度了，如果我们平时不注意的话我担心员工会想公司的制度只是给他们制定的，你认为我的想法是否有道理？\n5，如果你有不便面诉的想法可以在日志中告诉我。', 'false', '2015-03-26 00:05:16', 'clc8667668'),
('201504031306254769', '201504011752193841', '小杨姐，你的工作日志格式还是不对，用户日志标题那边写日期，不要写每天工作汇报', 'false', '2015-04-03 13:06:25', 'williamzhang'),
('201504050047006982', '201504031711211470', '现在在画什么图，哪个客户的，电话就打了30几个吗', 'false', '2015-04-05 00:47:00', 'clc8667668'),
('201504050050597313', '201504030955438343', '盛先生他侄女的情况怎么样了，跟单情况如何了是否要我出面啊，如果需要早点告诉我', 'false', '2015-04-05 00:50:59', 'clc8667668'),
('201504050054463477', '201504031712454069', '今天下午美都御府盛先生他侄女夫妻到公司说他们楼上的邻居家要装修，说和你说过的你有没有在跟单？', 'false', '2015-04-05 00:54:46', 'clc8667668'),
('201504050101009823', '201504011008476663', '做项目经理是比较辛苦的，不同岗位有不同的方式慢慢适应了就会好点，做工作还是要靠自己去总结经验的，好好干我不会让你吃亏的，不要在人家面前诉苦有想法可以在日志中写入我会看到的,别人是看不到的', 'false', '2015-04-05 01:01:00', 'clc8667668'),
('201504050106213877', '201504021724147893', '土巴兔网站和谁谈合作？是不是关于网上接业务的事项？', 'false', '2015-04-05 01:06:21', 'clc8667668'),
('201504050115482770', '201504031405509614', '日志明天坚持写要以身作则，月中会仪时可能还会强调日志事项到时如果你没有做好就不好了，这几天抓紧设计：广告册的方案我们回来前一定要定稿，世外桃源的广告方案设计一下这个月底前更换完成，淘宝网上订工地工人广告衫联系商家了解价格产品质量打标方案等', 'false', '2015-04-05 01:15:48', 'clc8667668'),
('201504062239095013', '201504061702547771', '阿东也需要拍照', 'false', '2015-04-06 22:39:09', 'williamzhang'),
('201504062239542182', '201504011008476663', '你怎么写过一次就不写了', 'false', '2015-04-06 22:39:54', 'williamzhang'),
('201504090132008822', '201504081518573742', '光纤问题是电信那边没有申请下来', 'false', '2015-04-09 01:32:00', 'williamzhang'),
('201504090132424166', '201504081729223820', '什么叫善后问题？能否详细解释一下', 'false', '2015-04-09 01:32:42', 'williamzhang'),
