('201504071918153394', 'williamzhang', '张泽南', '001-002', '还是需要一个独立的部门－－－财务部，不然以后行政部主管能看财务发的信息，感觉有问题', '财务部门的权限，财务部的员工有哪几种角色，麻烦告知。\nby 李嘉'),
