('201503232249234370', '2015-03-23 22:49:23', 'false', '201503201228038751', '1,整理材料照片，偶尔有材料未上传，(项目经理说有时未能及时到现场，现场施工人员又忘拍照，部分材料因体积或其他原因未能一一清点）\n2、材料单的整理及录入，\n3、现金日记账和银行日记账的整理及录入\n4、跑银行拿了备用金，给公司账户存了备用金以便社保扣款，通知工人来领取工资\n5、玉墅林枫11-203 沈医生交了二期工程款63000元\n     简爱西餐厅 交了二期工程款95000元\n     溪山美墅41-102 徐新凤 交定金3000元\n6、跟踪了解各工程进度情况和收款情况\n     目前百合公寓 徐静和保利原乡徐阿姨家以基本完工，可以交增减项和尾款\n     玉墅林枫3—901韩生华，保利原乡22—1003沈丽雅和美都御府7—906陈伟峰家三期工              程款未交，以上情况以与项目经理沟通，进款交款'),
