('201503291746354936', '2015-03-29 17:46:35', 'false', '201503291712244386', '26日\n        黄中明开工。\n        沈利刚，关于地板安装和地龙的处理事项。后期已经处理好。\n        蓝色港湾量房\n27日\n          一、 关于入户地面砖铺设不平事项，项目经理与泥工建议敲定全部来过。请示陈总\n            叫阿东看过，也认为要敲掉。29日我去马可波罗定砖，张根宝去量过了。\n         二、  打电话给黄中明确定空调和厨房  洁具，\n         三、去喜盈盈门业确认沈利刚家什么时候能装，回复我是4月15前一定能装。\n         四、打电话给韩升华提醒他集成吊顶，地板 灯具 移门都可以买齐。\n         五、联系胡先生（溪山美墅，陶总的外甥女婿），回复我是还没有去问韩总价格的事。\n28日\n        一、  联系林小姐（保利）说价格太高没有钱打算自己装，或去别的公司比下价格。\n        二、 联系瑜先生（蓝色港湾）下午到公司看平面方案，说过两天交定金。 \n        三、电话联系沈利刚家的大理石确认30日下午安装，这个事檀经理也和沈总本人说        \n               过了。\n        四、修改竣工图\n29日\n         一、整理竣工图，下午拿去打印，\n         二、  联系胡先生，人在杭州过两天过来\n         三、 去沈总工地看进度与量入户地砖的尺寸。l\n'),
