('201504050845172442', '2015-04-05 08:45:17', 'false', '201504050835539069', '1、中午黄中明过来看效果图与预算，效果比较满意，但是听朋友说地面用大理石比较难打扫与保护各方面原因坚持改为地砖，墙面部分地区也改为墙面砖。预算总价看了一下感觉有点高，预算价233000 到时候跟陈总谈下价格。他的心里价和姚小荣差不多\n2、下午陪黄中明去阿忠建材选瓷砖，已交好定金一万元。\n3、下午还看了空调，美生橱柜但是不是去哪里买，橱柜客户直接叫厂家朋友做，去美生看款式'),
('201504051409294673', '2015-04-05 14:09:29', 'false', '201504051407192453', '（1）余英坊小店面：和客户沟通订冷柜的尺寸。（上午白姐，菁菁）\n（2）玉墅林枫2幢902陈先生：木工进场，和木工沟通。（下午和沈菁菁，徐先正）\n（3）东方公馆时局：平面方案己定，施工图效果图要抓紧出。'),
('201504052137558291', '2015-04-05 21:37:55', 'false', '201504052130114085', '1.溪山美墅3幢901韩总家要求我们给他家打地龙，铺地板，韩总同意增项，是否可以先做，望批复。\n2.溪山美墅2幢902主卫客户不更改，按原设计施工。\n'),
('201504061646355449', '2015-04-06 16:46:35', 'false', '201504061317299653', '（1）溪山美墅41幢102徐姐：下午谈报价，最终价格己定。\n（2）下午接个电话，是装修咨询的。电话信息，己经留好。明天上午过公司。'),
('201504061654229836', '2015-04-06 16:54:22', 'false', '201504061646574744', '（1）溪山美墅41幢102徐姐：工地开工8：30早上（与檀银水）。下午合同己签，交3万元，明天来补交。\n（2）昨天上午咨询客户来公司了解情况，马上去量房（与李丹丹）\n        地址：南公馆3幢2单元304房；电话：13587924211；\n        初步了解：简装。'),
('201504061708412608', '2015-04-06 17:08:41', 'false', '201504061702547771', '1、完成每天所需工作\n2、溪山美墅41-102 徐新凤合同签订，首期款已收30000元，不足部分明天补交。\n3、项目经理东宁材料单有些没拍照片，他说太忙，有时刚好人又在别的工地。\n4、阿东给我的材料单都没有拍照的，是否也需要拍照？'),
