('201504071704192973', '2015-04-07 17:04:19', 'false', '201504071701246118', '4.7：上午和小白去了玉墅林枫沈医生家的房子，小白和木工在处理一些图纸上没画的细节部分；下午浏览了一些图片，画图'),
('201504071721056612', '2015-04-07 17:21:05', 'false', '201504071717241622', '1、完成每日所需工作\n2、溪山美墅41-102 徐新凤 今天过来把首期工程款补交齐全\n3、与国华油漆完成对账，现余欠合计为人民币41167元\n4、简爱西餐厅的款项已和老板讲过，说是过两天过来交款，倒时在跟进看看'),
