('201504080931422508', '2015-04-08 09:31:42', 'false', '201504080930326325', '1、每天各个工地走，买材料\n2、环龙机器的一楼会议室墙面装修方案和预算什么时候完成？客户急着要，客户好说另外增点东西，倒时可以算增项的'),
