('201504081221023262', '2015-04-08 12:21:02', 'false', '201504050836103674', '黄中明早上过来说三楼主卧三个门成直线，要求更改，但是轻质砖已经砌上去。\n还跟他说明地面改地砖要增加人工工资，预算也增上去为238800。要求他今天把合同签掉\n打个95折为226860，和他解释姚总的情况。他也理解但是想价格再低点，或是隔壁一样去掉油漆和木工的材料为多少（隔壁为130000，作为参考），最后还想等陈总回来谈价格。感觉这个人比较会算计，东西都是货比三家到现在还没有定下来（空调，橱柜。都还没有定下来）'),
('201504081222019194', '2015-04-08 12:22:01', 'false', '201504050836047798', '陈总这几天出差几天交代事宜。\n'),
('201504081239137300', '2015-04-08 12:39:13', 'false', '201504081208328360', '和檀经理去玉树凌风11-203沈医生家里，和木工多处地方调解确定尺寸。\n下午四点和沈医生约好在工地上\n1、他要求更改电视背景墙，感觉以前三个玻璃太简单。\n2、二楼过道原来的直流坪改为地板，干区地面为地砖，镜子后面打算改为马赛克两边墙面为墙面砖。不锈钢收口。\n3、主要问题还是楼梯二楼和钢管上面的玻璃和扶手没有解决掉，（做楼梯，做钢管昨天都在）弄到六点半，业主说晚上打电话给郑杰问他刚开始怎么考虑的。我从中电话给郑杰没有接，七点回我电话\n4、接手沈医生家才第一天发现了很多细节接口的问题，图纸上材质表示不清楚。设计很饱满现实很骨感。有些地方武康这里工艺跟不上。客户前期跟小郑说了要带点欧式，沙发看的也是欧式的。（还没有定)  。'),
('201504081522494673', '2015-04-08 15:22:49', 'false', '201504081518573742', '1、完成每天所需工作\n2、收到南公馆3-304  俞金平 设计定金2000元（新客户）\n3、环龙机器客户说这两天过来交款\n4、公司光纤网络一直没来安装\n5、今天刚关于求是和莫外的税金问题已解决，后求证款项已交，是他们之前没搞清楚'),
('201504081731298249', '2015-04-08 17:31:29', 'false', '201504081729223820', '1.微信平台已发送，准备好明天发送的内容\n2.下午16.42溪山美墅的陈女士打来电话说善后的工作\n3.玉树临风的通讯录已经输入完毕'),
