('201504091100382146', '2015-04-09 11:00:38', 'false', '201504091055494610', ':上午做册子内页的设计，下午带小杨和客户去一里洋房看我们家的房子，然后去了可可小姐家的店铺，去看了下工程的进度，并且在现场和业主关于工程进度的问题协商了很久，以及后续的一些问题。PS：我觉得白姐的沟通能力真的是有待加强'),
