('201504092057267967', '2015-04-09 20:57:26', 'false', '201504092039563903', '1、完成每天所需工作\n2、今收到金银岛4-1001 杨俊明第三期及尾款共计25000元，老迪欧咖啡和环龙机器的客户如果明天不来交钱我在打电话催下\n3、上午去社保办理好李丹丹跟夏靖的社保，明天上午去劳动局把夏靖的社保证明拿来\n4、帮前台整理和输入奥体一号的客户资料\n\n个人意见及建议:我觉得公司应该人性化管理，关于下午去卢球的事儿我觉得我是在工作，不是玩儿，同事偶尔有事相求我刚好有空不是应该顺带帮下忙么，个人觉得只要不耽误工作就好！如果说这样不可以，那我下次就只管好我自己的工作。'),
('201504100102565516', '2015-04-10 01:02:56', 'false', '201504100051306170', '\n\n\n\n今天我去了、美都玉府。预约了房东过来，就我们目前的工地情况。让客户催厂家把地板、门拉过来安装。客户现场打了电话，说这几天到货。\n\n\n'),
