('201504100133152659', '2015-04-10 01:33:15', 'false', '201504100122136922', ' 早上我到金银岛、油漆工进场铲顶。我给他安排了材料。卫生问题和他交代了。然后去了美都玉府603室。木门到了，谁知道厂家不够尽责啊。扔到门外不管，这下害死我了！'),
