('201504101603193691', '2015-04-10 16:03:19', 'false', '201504101601496914', '  4.10号会议记录\n1.以后每天要开晨会，时间为5-10分钟。\n2.活动内容：金牌施工队，零利润样板房限量5套，交1000抵1500.交2000抵3000，加送卫生间集成吊顶。\n3..已经把奥体一号的短信全部录入到移动e管家里面\n4.德清招聘网程锦峰应聘业务员。德清人才网收到邮件有人应聘行政人事'),
