('201504111734108230', '2015-04-11 17:34:10', 'false', '201504111727301554', '4.11：1、早上南公馆的客户来确定风格，已经确定为现代风格，看完后一直在画施工图；\n          2、下午春晖名居的客户上门咨询，和张泽南一起谈了一下，客户电话不肯留，我们发了名片给他们；\n          3、南公馆施工图出完后给小杨、小白审阅后改了一下，最终确定了已经发给张泽南做预算 并且发出去做了效果图 。\n          4、和小白去了玉墅林枫工地，然后去了简爱工地看了一下，已经在做油漆和门头贴字，快要完工了；接着又去了溪山美墅韩总家里，黄叔在打地龙，也快要完工了。'),
('201504111735479508', '2015-04-11 17:35:47', 'false', '201504111727427824', '1、每天完成所需工作\n2、整理好了公司办公用品盘存报告表，以后每半月我会统一整理一次，做好盘点工作，及时添加所需办公用品\n3、简爱老板娘电话打了，她说今天有事不能过来，明天下午一定过来，我计算了下，要交款项共计171850元（增项22000元+门面三期68850元+工程三期81000元）\n4、所需采购物品：卫生纸，纸杯，笔芯，回形针，垃圾袋'),
('201504111739238197', '2015-04-11 17:39:23', 'false', '201504111423352416', '1、给胡先生发消息具体活动内容，意思叫他近期快点来交定金。\n2、去甜品店工地看了一下，在油漆阶段，一切正常\n3、下午没有事去快完工的工地转了一下，沈李刚的在安装门，韩升华的在安装地板与门。顺道去看了下简爱咖啡\n4、预约沈医生过来看更改的电视背景墙，签字确定。\n5蓝色港湾的昨天给仔仔做预算，今天客户也打电话过来问，也向他解释了推迟的原因。效果图与施工已经按时完成，约客户明天过来。'),
('201504111759519012', '2015-04-11 17:59:51', 'false', '201504111756515616', '(1)余英坊雪媚娘：油漆在进行。（和白玉叶）\n（2）玉墅林枫2幢902陈先生：地面铺贴图纸修改。\n(3)东方公馆时局：图纸一切照常进行。'),
('201504111802401974', '2015-04-11 18:02:40', 'false', '201504111752069588', '明天美都玉府603地板可以铺完了，木门安装还须两天。接下来灯具安装、预计十天左右。全部完工'),
('201504112206456851', '2015-04-11 22:06:45', 'false', '201504112158415375', '1.下午跟小杨一起到玉墅林枫2幢902跟客户商量酒柜，最后还是确定由公司做，另外确定电视背景原设计软包改为贴磁砖。\n2.再次催溪山美墅2幢1301主材安装，客户说尽快但没有具体日期。\n'),
('201504112212426249', '2015-04-11 22:12:42', 'false', '201504112207087220', '1.溪山美墅2幢902跟客户协商决定南阳台贴墙砖。\n2.御景公馆3幢103三楼房门方案改动。\n3.保利原乡22幢1003客户決定地面找平铺地板增项。'),
('201504121651127703', '2015-04-12 16:51:12', 'false', '201504121634077434', '今天早上和小杨去了溪山美墅，就二楼卫生间、楼梯立了方案。然后就去了玉墅林风406，门已安装完毕。美都玉府603地板铺完，门、预计明天差不多做好。金银岛油工第一遍老粉差不多批好了，现在我在跟进美都玉府906房东。他们主材正在采购之中！我会再努力跟进。'),
('201504122105027074', '2015-04-12 21:05:02', 'false', '201504122048546198', '1、工地材料单整理及录入\n2、收到南公馆3-304俞金平首期工程款20200元（新客户）\n3、莫外的材料及人工成本整理好交给仔仔\n4、简爱的俩客户都联系过了，说要跟你谈谈在交工程款\n'),
('201504130859275117', '2015-04-13 08:59:27', 'false', '201504130842068408', '1、修改蓝色港湾柱子的间距。\n2、放样丰桥村委办公室的平面图，已经弄好，下午四点多姚总过来说不用设计，叫设计院弄\n3、中午两点多公司设计师和业务部跟张泽南去看一下小强砍价会的现场。\n4、下午一点多黄中明过来，拿了一块给我看下家里卫生间地面的防滑砖。还有高发的大理石报价，十二万多。他感觉太贵了，想问陈总有没有实惠的商家介绍。\n我昨天问了到现在空调和橱柜还没有定，工地上就等着水电放样。请问陈总这个工地我们是停一下还是继续施工。昨天又向他提一下什么时候签合同下来。他说这几天要出差两三天等回来在说。感觉这个人太狡猾，看我们已经给他施工了不可能停下来，这里又给你拖时间砍价格。我认为这个人应该的尽快给他确定下来签掉。这样项目经理也好按程序施工。\n5、蓝色港湾昨天不在德清，明天过来。'),
('201504131237324972', '2015-04-13 12:37:32', 'false', '201504131224108692', '4.12:1、早上一早上在对效果图，预算给仔仔在做。\n        2、下午和仔仔、小杨、小白、小胡去了小强热线主材订购现场看了一下他们在搞的活动。\n       3、打电话给南公馆的客户过来看预算和效果图、施工图，价格谈了一下最终签订了合同，交了第一笔工程款，明天开工。'),
('201504131707355621', '2015-04-13 17:07:35', 'false', '201504131705031935', '1.已经准备好明天微信公众后发送的内容。\n2.招聘信息已经更新\n3.电脑上的通讯录名单已经导入到手机里'),
('201504132218585250', '2015-04-13 22:18:58', 'false', '201504132214042453', '1.南公馆开工，跟客户设计师三方碰面，提醒预订洁具磁砖厨柜大理石。\n2.御景公馆等客户预定空调厨柜。'),
('201504140834346871', '2015-04-14 08:34:34', 'false', '201504140830555122', '4.13:1、早上南公馆开工，和小杨、徐经理去了工地上示意的敲了一下墙，下午正式敲墙。\n        2、工地回来后直接和业主去了卢球，选好了卫浴、地砖，水电进场时再让商家去放样，量尺寸，做方案。\n       3、下午去看了橱柜，目前还没定下来，业主说要再考虑考虑 。'),
('201504141718566291', '2015-04-14 17:18:56', 'false', '201504141716091072', '4.14:1、和白姐去了余英坊，看了一下门头是否颜色太深，那里已经在铺地板\n        2、下午带小胡去了保利扫楼，回来后和小杨去了橱柜店看了一下\n        '),
('201504141844375361', '2015-04-14 18:44:37', 'false', '201504141841228331', '1、招投标 餐厅已经设计完成已安排人在做效果图。明天安排大厅\n2、和菁菁去看下甜品店，门头颜色的漆，一切正常。\n3,、去看沈医生家木工尺寸确定。'),
('201504141847129585', '2015-04-14 18:47:12', 'false', '201504130859413793', '瑜先生过来谈预算和施工图\n陈总分配工作，苏州一个招投标的项目，三张效果图，答应一个星期完成（20号）\n'),
('201504142154591829', '2015-04-14 21:54:59', 'false', '201504142150364587', '1.溪山美墅2幢1301客户主材定好，明天跟尚品宅配现场确定定做酒柜书柜具体位丹。\n.南公馆主材定好。'),
('201504150619492992', '2015-04-15 06:19:49', 'false', '201504150608425587', '今天沈总家大理石总算有个了解，砸了换。厂家说明天来安装，我真心希望他说的话是真的。因为这家太没信用！'),
('201504150909248384', '2015-04-15 09:09:24', 'false', '201504150902205657', '1、整理以录入现金日记账和银行日记账，明细和汇总分别录入整理\n2、材料单的整理和录入\n3、简爱西餐厅收款共计人民币壹拾叁万元整,（130000元）\n4、开发区求是高中成本重新整理以及核对'),
('201504151242316780', '2015-04-15 12:42:31', 'false', '201504151241596805', '沈菁菁请假。 请假原因： 休息一天 请假时间： 从2015-04-16 到 2015-04-17。'),
('201504151620589408', '2015-04-15 16:20:58', 'false', '201504151619508882', '蓝色港湾签定合同'),
('201504151623482565', '2015-04-15 16:23:48', 'false', '201504151619275660', '(1)一里洋房6幢2单元804室张总：量房（和胡燕）上午。\n（2）溪山美墅41幢102徐姐：约徐姐老公楼梯位置确定下。（和檀银水）下午'),
('201504151627033622', '2015-04-15 16:27:03', 'false', '201504151624593193', '(1)一里洋房6幢2单元804室张总：图纸平面全部弄好。上午；下午；和客户联系，和客户确定风格。\n');
INSERT INTO `log_detail` (`id`, `createTime`, `isDeleted`, `logListId`, `content`) VALUES
('201504151636376569', '2015-04-15 16:36:37', 'false', '201504151629057035', '1.德清人才网王琴曹应聘，具体应聘那个岗位没写。\n2.孔先生应聘行政人事经理。\n3.史国兵应聘管理类的职位。\n4.夏良英应聘行政 '),
('201504151731166710', '2015-04-15 17:31:16', 'false', '201504151724506710', '1、整理录入材料单\n2、收到蓝色港湾46-1102 俞佳斌首期工程款13400元（新客户）\n3、阿东把开发区求是高中消防改建工价单放我这边，说是让您过目，看价格是否合理\n4、今天跑社保去了解社保取消的资料，还要劳动解除协议等资料，东西不齐全，这几天整理下到时去解除黄超和方迎春的社保\n5、下午跑银行领了备用金'),
('201504152126432445', '2015-04-15 21:26:43', 'false', '201504152020576454', '今天早上六点多就去了，玉墅林风。配合大理石安装。没想到他还是没有给我搞好，真是气死我了！不过灯具还是装完了。希望大家以后不要和这样厂家合作！'),
('201504160906324599', '2015-04-16 09:06:32', 'false', '201504160905425143', '已完成杂志内页的设计'),
('201504160907235554', '2015-04-16 09:07:23', 'false', '201504160906415281', '世外桃源版面设计中'),
('201504160908508358', '2015-04-16 09:08:50', 'false', '201504160907311235', '上午办光纤，去了医院，下午设计完成了光荣榜，并去了印刷厂跟他们确认了封面的纸张材质'),
('201504161454072854', '2015-04-16 14:54:07', 'false', '201504161452478062', '1. 裸心谷大理石台盆及大理石台面\n2. 裸心谷移门\n'),
('201504161941052366', '2015-04-16 19:41:05', 'false', '201504161931546932', '今天我和设计师小杨、还有小胡去了美都玉府603工地，基本就是等主家厨柜、还有墙纸。厨柜还要半个月才过来、唉！急啊 '),
('201504161949302154', '2015-04-16 19:49:30', 'false', '201504161942583059', '通过我多次催房东、终于美都玉府906明天装灯饰了。还有门、墙纸、橱柜。接着催吧！'),
('201504161959197026', '2015-04-16 19:59:19', 'false', '201504161958089124', '完成每天所需工作'),
('201504162220523396', '2015-04-16 22:20:52', 'false', '201504162216541187', '1.御景公馆3幢103空调，厨柜洁柜己定好。\n2.溪山美墅2幢1301不锈钢定做。'),
('201504171050516681', '2015-04-17 10:50:51', 'false', '201504170839563493', '1、御景公馆3-103水电放样，预算调整'),
('201504171527094185', '2015-04-17 15:27:09', 'false', '201504171524037921', '1、材料单的整理以及录入\n2、整理和办理黄超和方迎春社保停止资料以及造价员赵丹莹的社保增加资料，全部已办理\n3、跑水务局和电力局打发票，电力局其中公司一个账号钱未扣，可能账户没钱了\n'),
('201504171718064765', '2015-04-17 17:18:06', 'false', '201504171628482168', '1.德清人才网沈秋平应聘行政\n2.更新墙上的工程进度'),
('201504171724198827', '2015-04-17 17:24:19', 'false', '201504171720571402', '4.17:1、早上和南公馆的业主联系，主要是为了整体厨房的定制\n        2、下午和仔仔、小胡去了一里洋房量房，顺便带业主看了仔仔家的样板房\n        3、下午南公馆业主过来后，去看了一下整体橱柜，已经定好了\n        4、橱柜店回来后一直在放一里洋房的框架图'),
('201504180934577081', '2015-04-18 09:34:57', 'false', '201504180931553259', '1.溪山美墅3幢901客厅沙发背景原木饰面改动。'),
('201504181534343850', '2015-04-18 15:34:34', 'false', '201504181532302280', '13.44分陈师傅来应聘泥水匠，他已经跟檀经理沟通过，并留下了联系方式'),
('201504181639468896', '2015-04-18 16:39:46', 'false', '201504181634250457', '1早上回访了前两天有意愿要来公司的客户，暂时只有一位客户说明天有空会来！了解公司活动，电话销售参考资料。\n2了解电话销售参考资料。去保利原乡扫了最后一幢楼   明天开始各客户打电话！'),
('201504182105508844', '2015-04-18 21:05:50', 'false', '201504182104453141', '1.到金华市考试。'),
('201504191552541722', '2015-04-19 15:52:54', 'false', '201504191547489360', '湖州立同家具店打来电话问有没有合作的意向'),
('201504191610281819', '2015-04-19 16:10:28', 'false', '201504191606242190', '1、整理公司从开业以来的客户资料，包含工程地址，客户名称，联系方式，收付款情况以及完工时间等，有的信息已全部整理好\n2、公司3月份员工工资的计算，整理\n3、材料单的整理以及录入'),
('201504192254258068', '2015-04-19 22:54:25', 'false', '201504192252183866', '1.南公馆3幢304水电放样，厨柜洁具现场放样。'),
('201504200830038952', '2015-04-20 08:30:03', 'false', '201504200824522570', '4.19:1、早上一里洋房的户型在做平面方案，大概10点多徐经理和我联系去南公馆水电放样，联系了橱柜店的和卫浴店的一起去了现场和水电师傅放样 \n       2、下午和白姐去了玉墅林枫工地，一点多去金都阳光花园量房  ，回来继续做方案，后来又和小杨去了104过道那边量 店面房  '),
('201504200840549135', '2015-04-20 08:40:54', 'false', '201504200838019821', '1、18号联系的客户来公司了解方案\n2、给客户发短信打电话'),
('201504201657505305', '2015-04-20 16:57:50', 'false', '201504201654112344', '1、3月员工工资的发放\n2、现金日记账和银行日记账的录入\n3、材料单的整理和录入\n4、工地工人工资的认领'),
('201504201709483390', '2015-04-20 17:09:48', 'false', '201504201654112344', '个人意见及建议\n通过每月公司考勤的整理，发现偶尔有些员工休息天数少于公司规定天数，根据迟到早退要扣钱的原理，那该休而因工作没有休的员工是否也有奖励呢，这样我觉得能提高大家工作积极性，赏罚分明，当然，一般情况下大家都是把假期给休完的'),
('201504201725025080', '2015-04-20 17:25:02', 'false', '201504201722069688', '1.了解与客户沟通需要的参考材料。\n2.给客户发短信，告知客户公司活动内容。\n3。给客户打电话，暂时没有客户有意向到公司了解。'),
('201504201725274371', '2015-04-20 17:25:27', 'false', '201504201722599842', '4.20:1、早上帮白姐姐放金都阳光花园的户型图\n        2、下午一里洋房的方案发给小杨、白姐，然后一起在探讨看看'),
('201504211408068882', '2015-04-21 14:08:06', 'false', '201504211402551538', '（1）溪山美墅41幢102徐姐：看别人己经装好的房子，楼梯方案确定。车库卫生修改。（和客户、檀银水）。上午\n（2）量房：（地址：鑫盛小区红木家具卖厂；电话：13706823930叶总）（陈总、沈菁菁）'),
